          <p style="font-size:14px;"><span style="font-family:'Arial Normal', 'Arial';text-decoration:none;">导入校验规则：</span></p><p style="font-size:13px;"><span style="font-family:'Arial Normal', 'Arial';font-size:14px;text-decoration:none;">1、必填数据：</span><span style="font-family:'Arial Normal', 'Arial';text-decoration:none;">姓名、性别、身份证号、手机号、类型、入职时间</span></p><p style="font-size:13px;"><span style="font-family:'Arial Normal', 'Arial';text-decoration:none;">2、有条件必填数据：当类型为司机时，驾驶证号、</span><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">准驾车型、驾驶证办证日期、驾驶证有效日期必填</span></p><p style="font-size:13px;"><span style="font-family:'Arial Normal', 'Arial';font-size:14px;text-decoration:none;">3、数据有效：</span><span style="font-family:'Arial Normal', 'Arial';text-decoration:none;">类型、</span><span style="font-family:'PingFangSC-Regular', 'PingFang SC';text-decoration:none;">准驾车型</span><span style="font-family:'Arial Normal', 'Arial';font-size:14px;text-decoration:none;">在系统对应的选项范围内；驾驶车辆车牌号码在系统存在且未分配司机</span></p><p style="font-size:14px;"><span style="font-family:'Arial Normal', 'Arial';text-decoration:none;"><br></span></p><p style="font-size:14px;"><span style="font-family:'Arial Normal', 'Arial';text-decoration:none;">状态默认为“在职”</span></p>
